    const [loading, setLoading] = useState(true);
    const [dados, setDados] = useState([])
    const itens = ['Item 1', 'Item 2', 'Item 3'];


  useEffect(() => {
    fetch('http://localhost:8000/api/campos', {
      method: 'GET',

    })
      .then(response => response.json())
      .then(data => {
        setDados(data);
        setLoading(false)
      })
      .catch(error => {
        console.log(error);
      });
  }, [dados]);

  return (
    <div>
        <h2>Lista</h2>

